import { Routes, Route, Link } from "react-router-dom";
import Login from "./Login";
import Profile from "./Profile";


function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Login/>}/>
        <Route path="login" element={<Login/>}/>
      </Routes>
    </div>
  );
}

export default App;
